import { BrowserRouter as Router, Route } from "react-router-dom";
import Nav from "./nav";
import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>시작 페이지</h1>
      <img src="logo.png" alt="로고" />
      <Link to="/main">
        <button>시작하기</button>
      </Link>
    </div>
  );
}

export default App;
